description:
Telecall is an app that lets you make FREE phone calls to other iPhone users that have Telecall installed, and save money on your international calls!

FREE credits to call anywhere in the world. 

Telecall it is not just another VoIP app. 
We have 3 different calling systems:

• 3G/Wifi: VoIP call will use the Internet to connect your call;

• Callthrough: With Callthrough you can make calls even without internet. App will call a local access number and we will connect your international call at incredibly lower rates.

• Callback: You tell us were you want to call, and we will call you back and than connect the call. Callback will save you money in Countries where local access is not available.

Features: 

• FREE International calls to other Telecall users using 3G or Wi-Fi; 
• FREE credits to call anywhere in the world; 
• Low cost international calls from your mobile to any mobile and landlines. 
• Callthrough: Call even without internet; 
• Callback; 
• Conference Call; 
• Voice Mail; 
• Call Transfer; 
• Call forwarding; 
• Call recording; 
• Quick dial screen to save your 12 most called contacts; 
• Integrated with your existing contact list; 
• Display balance; 
• Top up your account directly on your phone; 
• Keep your current SIM card and number; 
• No contracts;
• No maintenance fees;
• No connections fees;
• No hidden charges!
• and much more!!! 

Download our free app now and start saving money on your international calls today!
